public class InnerSecurityConfigurationEncryptionConfigurationFactory(Action<Humidifier.Glue.SecurityConfigurationTypes.EncryptionConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Glue.SecurityConfigurationTypes.EncryptionConfiguration>
{

    internal InnerSecurityConfigurationS3EncryptionsFactory S3EncryptionsFactory { get; set; }

    internal InnerSecurityConfigurationCloudWatchEncryptionFactory CloudWatchEncryptionFactory { get; set; }

    internal InnerSecurityConfigurationJobBookmarksEncryptionFactory JobBookmarksEncryptionFactory { get; set; }

    protected override Humidifier.Glue.SecurityConfigurationTypes.EncryptionConfiguration Create()
    {
        var encryptionConfigurationResult = CreateEncryptionConfiguration();
        factoryAction?.Invoke(encryptionConfigurationResult);

        return encryptionConfigurationResult;
    }

    private Humidifier.Glue.SecurityConfigurationTypes.EncryptionConfiguration CreateEncryptionConfiguration()
    {
        var encryptionConfigurationResult = new Humidifier.Glue.SecurityConfigurationTypes.EncryptionConfiguration();

        return encryptionConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Glue.SecurityConfigurationTypes.EncryptionConfiguration result)
    {
        base.CreateChildren(result);

        result.S3Encryptions ??= S3EncryptionsFactory?.Build();
        result.CloudWatchEncryption ??= CloudWatchEncryptionFactory?.Build();
        result.JobBookmarksEncryption ??= JobBookmarksEncryptionFactory?.Build();
    }

} // End Of Class

